        this.projects = [];
    }
    async ngOnInit() {
        await this.getProjects();
    }
    async getProjects() {
        await this.projectService.getProjects().subscribe(data => {
            this.projects = data;
        });
        console.log(this.projects);
        console.log("hello");
    }
}
